        <script type="text/javascript">
            jq(document).ready(function(){
                jq('#toggle-view li a').click(function () {
                    var text = (jq(this).parent()).children('div.panelMM');
                    if (text.is(':hidden')) {
                        text.slideDown('200');
                        (jq(this).parent()).children("a").children("span").html('&lt;img src="/ws/images/menu-minus.gif" border="none"&gt;');
                        createCookie(jq(this).parent().attr("id"), 'show', 365);
                    } else {
                        text.slideUp('200');
                        (jq(this).parent()).children("a").children("span").html('&lt;img src="/ws/images/menu-plus.gif" border="none"&gt;');
                        eraseCookie(jq(this).parent().attr("id"));
                    }
                });

                jq("#toggle-view li").each(function() {
                    // toggleMenu(this);
                    checkCookie(this);
                });

                function checkCookie(obj) {
                    // check if there is a cookie set for a sub menu if there is then show the menu
                    var cookieName = obj.id;
                    var c = readCookie(cookieName);

                    if(c == 'show') {
                        jq(obj).children("a").children("span").html('&lt;img src="/ws/images/menu-minus.gif" border="none"&gt;');
                        var text = jq(obj).children('div.panelMM');
                        text.show();
                    }
                }

                // init session expiry monitor
                initSessionMonitor('43200', '/ws/');
            });

            function createCookie(name,value,days) {
                if (days) {
                    var date = new Date();
                    date.setTime(date.getTime()+(days*24*60*60*1000));
                    var expires = "; expires="+date.toGMTString();
                }
                    else var expires = "";
                document.cookie = name+"="+value+expires+"; path=/";
            }
            function readCookie(name) {
                var nameEQ = name + "=";
                var ca = document.cookie.split(';');
                for(var i=0;i &lt; ca.length;i++) {
                    var c = ca[i];
                    while (c.charAt(0)==' ') c = c.substring(1,c.length);
                    if (c.indexOf(nameEQ) == 0) return c.substring(nameEQ.length,c.length);
                }
                return null;
            }
            function eraseCookie(name) {
                createCookie(name,"",-1);
            }
        </script>
